import React from 'react';

import {
    StyledContainer,
    InnerContainer,
    PageLogo,
    PageTitle
} from './../components/styles';

const Login = () => {
    return (
        <StyledContainer>
            <InnerContainer>
                <PageLogo resizeMode="cover" />
                <PageTitle>Escrosis</PageTitle>
            </InnerContainer>
        </StyledContainer>
    );
}

export default Login;
